import './App.css';
import  React from 'react';
import {BrowserRouter, Route , Switch} from 'react-router-dom';
import { Home } from './pages/Home';




function App() {
  return (
   <BrowserRouter>
     <div className="container pt-4">
        <Switch>
            <Route path={'/'} exact component={Home} />
        </Switch>
    </div>
   </BrowserRouter>
  );
}

export default App;
